const ComA =()=>{

    const [num,setNum]=useState(0);
    useEffect(()=>{
        document.title=`you clicked me ${num} times`;
    }) 

            return(
                <>
                    <button onClick={()=>{
                        setNum(num+1)
                    }}>click {num}</button>
                </>
            )
}
